import React from 'react';
import './App.css';

function App() {
  return (
    <div className="h-screen bg-blue-500 flex items-center justify-center">
      <div className="bg-white p-10 rounded shadow-lg w-1/2 space-y-6 text-center">
        <h1 className="text-4xl font-bold text-blue-500">Path - The Self-Discovery Journal</h1>
        <p className="text-lg text-gray-800">
          A better way to present your app using fully featured appsperia template.
          <br />
          Now available on the App Store and Play Store!
        </p>
        <button className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded">Download App</button>
      </div>
    </div>
  );
}

export default App;
